window.bookSummaryJSON = "<p><b>When a woman overhears a murder plot on her morning commute, she races to stop it—only to be pulled in deeper than she ever could have imagined.</b></p> <p>Amy Nichols (Lizzy Caplan) was an FBI agent with a dogged need to protect everyone—until that instinct caused her to mishandle a crisis, lose innocent lives, and lose her job. Now a civilian working in private security, that mistake still haunts her.</p> <p>One morning on the commuter train, she overhears a young couple plotting a murder. Ignoring warnings from her family and friends, Amy’s instinct to protect and serve compels her to investigate. But the further she goes, the more she finds her own life in danger.</p> <p>Filled with mystery, suspense, and more twists and turns than a rail line, <i>The Commuter</i> is a gripping thriller by James Patterson, the world’s best-selling author.</p> <p>Available in Dolby Atmos on Audible.</p> <p><b>Please note: This audio drama is for mature audiences only. It contains strong language, violence, and sexual content. Discretion is advised.</b></p>"; 
